import React, { useState, useEffect } from 'react';
import { useDispatch, useSelector } from 'react-redux';
import { loadItemGroups } from '../../store/ItemGroups.actions';
import ItemGroups from './ItemGroups';

function Home() {
    const [ itemGroups, setItemGroups ] = useState([]);

    useEffect(() => {
        async function load() {
        await fetchItemGroups().then(setItemGroups);
        }
        load();
    },[]);

    const groupList = Object.keys(itemGroups).map((key) => {
        const itemGroup = itemGroups[key];
        return itemGroup;
    });

    console.log(`groupList is, `, groupList);



    return (
        <div className='Home'>
            <h1>Welcome to Emil's Quality Honey and Bee Product Specialities!</h1>
            <h5>(Since 2024!)</h5>
            <h3>Every product is organic and intimately fostered by farmer Emil. Have a look:</h3>
            <div className="itemGroupWrapper">
                <ItemGroups data={groupList} key={groupList.id} />
            </div>
        </div>
    );
};

export default Home;
